import styled from "@emotion/styled";
import { Box, Typography } from "@mui/material";

const Component = styled(Box)`
    display:flex;
    height:45px;
    padding:13px 0;
    cursor: pointer;
`

const Image = styled('img')({
    width:50,
    height:50,
    borderRadius:'50%',
    padding: '0 14px',
    objectFit:'cover'
})
const Conversation = ({user}) =>{
    return(
       <Box>
        <Box>
            <img src={user.picture} alt="dp"/>
        </Box>
        <Box>
           <Box>
            <Typography>
                {user.name}
            </Typography>
           </Box>
        </Box>
       </Box>
    )
}

export default Conversation;
